import React from 'react';
import { Card, Button } from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

const Menu = () => {
    return (
        <div id="menu">
            <Card style={{ width: '18rem' }}>
                <Card.Img variant="top" src="/Hyderabadi-chicken-Biryani.jpg" />
                <Card.Body>
                    <Card.Title>Hyderabadi Dum Biriyani</Card.Title>
                    <Button variant="primary" href="#order">Order Now</Button>
                </Card.Body>
            </Card>
            {/* Similar Cards for Other Items */}
        </div>
    );
}

export default Menu;
